import logo from './logo.svg';
import './App.css';

import React, { useState } from 'react';

function Title() {
  const [margin, setMargin] = useState(0);

  const handleMouseEnter = () => {
    if(margin < 10){
      margin ++
    }
  };

  const handleMouseLeave = () => {
    if(margin > 0){
      margin --
    }
  };

  return(
    <div 
      className="isolate titles"
      onMouseEnter={handleMouseEnter}
      onMouseLeave={handleMouseLeave}
    >
      <a 
        href="index.html" 
        id="title" 
        className="title rainbow blue"
        style={{ marginLeft: -1 * margin + 'px' }}
      >
        JackSavini.com
      </a>

      <a href="index.html" id="title" className="title rainbow green">JackSavini.com</a>

      <a
        href="index.html"
        id="title"
        className="title rainbow red"
        style={{ marginLeft: margin + 'px' }}
      >
        JackSavini.com
      </a>
    </div>
  )
}

function App() {
  return (
    <Title/>
  );
}

export default App;
